import React from 'react';
import Person from './Person';
import {people} from './People'

const list = people.map(i=>{
    return i;
})

const Personlist = ()=>{
    return (
         
        <div>
            <Person 
               
               name={people[0].name} 
                email={people[0].email}
                    treet1={people[0].address.street}
                    street2={people[0].address.suite}
                    street3={people[0].address.city}
                />
            
        </div>
    )
}

export default Personlist
